import React from "react";
import './Card.css';
import img from '../../images/Pr-1.png';

export default function Card(props){
    return(
        <>
        <div className="Card">
              <div className="text">{props.text}</div>
              <img src={img} alt="" />
        </div>
        </>
    );
}
